private static String determinePropParamLayoutCss(ScalarModel model) {
    final LabelAtFacet facet = model.getFacet(LabelAtFacet.class);
    if (facet != null) {
        switch (facet.label()) {
        case LEFT:
            return "label-left";
        case RIGHT:
            return "label-right";
        case NONE:
            return "label-none";
        case TOP:
            return "label-top";
        case DEFAULT:
        case NOT_SPECIFIED:
        default:
            break;
        }
    }
    return "label-left";
}

